(6, 'Teknik Mesin', 'ME', 'Teknik_Mesin.jpg', '<figure class=\"image\"><img style=\"aspect-ratio:960/540;\" src=\"https://sp-ao.shortpixel.ai/client/to_webp,q_glossy,ret_img,w_960/https://www.pnp.ac.id/wp-content/uploads/2023/01/TEKNIK-MESIN-2023.png\" width=\"960\" height=\"540\"></figure><h2><span style=\"color:hsl(0, 0%, 0%);\"><strong>Visi, Misi, Tujuan Dan Strategi</strong></span></h2><p><span style=\"color:hsl(0, 0%, 0%);\"><strong>Visi</strong></span></p><p style=\"text-align:center;\"><span style=\"color:hsl(0, 0%, 0%);\">Menjadi Jurusan yang berwawasan Internasional dalam Penerapan Teknologi untuk menciptakan Alumni dan Karya Unggul</span></p><p><span style=\"color:hsl(0, 0%, 0%);\"><strong>Misi</strong></span></p><ol><li><span style=\"color:hsl(0, 0%, 0%);\">Membuat program yang sesuai dengan Kebutuhan Masyarakat melalui Pendidikan dan Penelitian.</span></li><li><span style=\"color:hsl(0, 0%, 0%);\">Melaksanakan Pengabdian Kepada Masyarakat dan Kerjasama Industri dengan cara membuat Teaching Factory dan penerapan Revolusi Industri 4.0</span></li></ol><p><span style=\"color:hsl(0, 0%, 0%);\"><strong>Tujuan</strong></span></p><ol><li><span style=\"color:hsl(0, 0%, 0%);\">Mempunyai Karya Bermutu dan Prestasi Internasional</span></li><li><span style=\"color:hsl(0, 0%, 0%);\">Mempunyai Program Tersertifikasi dan Praktisi Mengajar</span></li><li><span style=\"color:hsl(0, 0%, 0%);\">Mempunyai Kurikulum Terintegrasi dan Teaching Factory</span></li><li><span style=\"color:hsl(0, 0%, 0%);\">Menerapkan Revolusi Industri 4.0 dan memperbaiki Manajemen Jurusan</span></li></ol><p><span style=\"color:hsl(0, 0%, 0%);\"><strong>Strategi</strong></span></p><ol><li><span style=\"color:hsl(0, 0%, 0%);\">Menciptakan Alumni dan Karya Bermutu sesuai Kebutuhan Masyarakat dan Industri</span></li><li><span style=\"color:hsl(0, 0%, 0%);\">Berusaha meraih prestasi akademik dan non akademik pada tingkat internasional</span></li><li><span style=\"color:hsl(0, 0%, 0%);\">Membuat Program Tersertifikasi untuk menunjang MBKM</span></li><li><span style=\"color:hsl(0, 0%, 0%);\">Mengundang Praktisi mengajar dari Industri</span></li><li><span style=\"color:hsl(0, 0%, 0%);\">Memperbaiki Kurikulum sesuai dengan Produk Unggulan</span></li><li><span style=\"color:hsl(0, 0%, 0%);\">Mengembangkan Teaching Factory untuk menjalin Kerjasama Industri</span></li><li><span style=\"color:hsl(0, 0%, 0%);\">Memperbaiki Hubungan Industri dengan menerapkan Revolusi Industri</span></li><li><span style=\"color:hsl(0, 0%, 0%);\">Memperbaiki Manajemen Jurusan untuk menuju Akreditasi Internasional</span></li></ol><p><span style=\"color:hsl(0, 0%, 0%);\"><strong>Motto</strong></span></p><p><span style=\"color:hsl(0, 0%, 0%);\">Creative, Communicative and International Perspective</span></p>', 'https://me.pnp.ac.id/', '2023-11-25 00:32:59', '2023-11-28 00:59:39'),
(9, 'Teknik Sipil', 'SP', 'Teknik_Sipil.jpg', '<figure class=\"image\"><img style=\"aspect-ratio:960/540;\" src=\"https://sp-ao.shortpixel.ai/client/to_webp,q_glossy,ret_img,w_960/https://www.pnp.ac.id/wp-content/uploads/2023/01/TEKNIK-SIPIL-2023.png\" width=\"960\" height=\"540\"></figure><h2><span style=\"color:hsl(0,0%,0%);\"><strong>Visi, Misi, Tujuan dan Sasaran</strong></span></h2><h3><span style=\"color:hsl(0,0%,0%);\"><strong>Visi</strong></span></h3><p><span style=\"color:hsl(0,0%,0%);\"><i>Pada tahun 2025 menjadi unit pengelola program studi vokasional teknik sipil yang bermartabat, andal,unggul dan berstandar internasionl</i></span></p><h3><span style=\"color:hsl(0,0%,0%);\"><strong>Misi</strong></span></h3><p><span style=\"color:hsl(0,0%,0%);\"><i>1. Mengelola Program Studi pendidikan vokasional yang inovatif , aplikatif dan adaptif untuk menghasilkan lulusan yang kompeten, berjiwa kewirausahaan dan berwawasan internasional.</i></span></p><p><span style=\"color:hsl(0,0%,0%);\"><i>2. Melaksanakan program penelitian yang bermanfaat bagi masyarakat dan berkonstribusi pada pengembangan keilmuan terapan serta pencapaian hak atas kekayaan intelektual (HKI) dan paten.</i></span></p><p><span style=\"color:hsl(0,0%,0%);\"><i>3. Menghasilkan karya pengabdian kepada masyarakat yang berbasis pada teknologi terapan untuk meningkatkan kesejahteraan masyarakat .</i></span></p><p><span style=\"color:hsl(0,0%,0%);\"><i>4. Menjalin kerja sama yang produktif dan berkelanjutan dengan lembaga pendidikan, pemerintahan, dan dunia usaha di tingkat nasional dan internasional.</i></span></p><h3><span style=\"color:hsl(0,0%,0%);\"><strong>Tujuan</strong></span></h3><p><span style=\"color:hsl(0,0%,0%);\">Berdasarkan visi dan misi yang telah ditetapkan, tujuan yang ingin dicapai oleh Unit Pengelola Program Studi vokasional teknik Sipil adalah :</span></p><ol><li><span style=\"color:hsl(0,0%,0%);\">Menjadikan program studi yang unggul dilingkungannya agar lulusannya bertaqwa kepada Tuhan Yang Maha Esa, bermartabat, kompeten, dan mendapatkan pengakuan secara nasional dan internasional.</span></li><li><span style=\"color:hsl(0,0%,0%);\">Menghasilkan penelitian yang bermanfaat untuk pengembangan dan penerapan ilmu pengetahuan dan teknologi, pencapaian hak atas kekayaan intelektual (HKI) dan paten untuk mendukung kemandirian bangsa</span></li><li><span style=\"color:hsl(0,0%,0%);\">Menghasilkan karya pengabdian kepada masyarakat yang berbasis pada teknologi terapan untuk meningkatkan kesejahteraan masyarakat</span></li><li><span style=\"color:hsl(0,0%,0%);\">Meningkatkan mutu pelayanan melalui penyediaan fasilitas, prasarana, sarana dan teknologi informasi sesuai dengan Standar Nasional Pendidikan Tinggi</span></li><li><span style=\"color:hsl(0,0%,0%);\">Meningkatkan dosen dan tenaga kependidikan yang berkualifikasi dan bersertifikasi.</span></li><li><span style=\"color:hsl(0,0%,0%);\">Memperluas dan meningkatkan jaringan kerjasama dengan berbagai lembaga pemerintah/swasta di dalam dan luar negeri yang saling menguntungkan.</span></li><li><span style=\"color:hsl(0,0%,0%);\">Mewujudkan pengembangan Program Studi Vokasi yang relevan dengan industri jasa konstruksi yang berkualitas dan berkesinambungan</span></li></ol><h3><span style=\"color:hsl(0,0%,0%);\"><strong>Sasaran</strong></span></h3><p><span style=\"color:hsl(0,0%,0%);\">Untuk mencapai tujuan tersebut, maka Unit Pengelola Program Studi Vokasional Teknik Sipil menetapkan 9 sasaran strategi sebagai berikut :</span></p><ol><li><span style=\"color:hsl(0,0%,0%);\">Tersedianya sarana dan prasarana serta fasilitas pendukung proses pembelajaran yang menekankan pada penguasaan keahlian terapan dan berjiwa kewirausahaan;</span></li><li><span style=\"color:hsl(0,0%,0%);\">Terbentuknya organ-organ penyelenggara Jurusan Teknik Sipil dan tata kelola organisasi yang tangguh, mandiri dan terpadu;</span></li><li><span style=\"color:hsl(0,0%,0%);\">Meningkatnya kualitas lulusan berbasis kompetensi, daya saing dan bermartabat di tingkat nasional maupun internasional;</span></li><li><span style=\"color:hsl(0,0%,0%);\">Adanya penelitian aplikatif yang bermanfaat dalam pengembangan dan penerapan ilmu pengetahuan dan teknologi, pencapaian hak atas kekayaan intelektual (HKI) dan paten</span></li><li><span style=\"color:hsl(0,0%,0%);\">Adanya karya pengabdian kepada masyarakat yang berbasis pada teknologi terapan untuk meningkatkan kesejahteraan masyarakat</span></li><li><span style=\"color:hsl(0,0%,0%);\">Meningkatnya mutu pelayanan melalui manajemen yang efektif dan efesien bagi civitas dengan menerapkan teknologi informasi sesuai dengan Standar Nasional Pendidikan Tinggi</span></li><li><span style=\"color:hsl(0,0%,0%);\">Tersedianya dosen dan tenaga kependidikan yang berkualifikasi dan bersertifikasi.</span></li><li><span style=\"color:hsl(0,0%,0%);\">Ada peningkatan jaringan kerjasama dengan berbagai lembaga pemerintah/swasta di dalam dan luar negeri yang saling menguntungkan</span></li><li><span style=\"color:hsl(0,0%,0%);\">Terwujudnya program studi baru yang relevan untuk memenuhi kebutuhan industri dan masyarakat</span></li></ol>', 'https://sipil.pnp.ac.id/', '2023-11-27 09:56:59', '2023-11-28 01:00:46'),
(10, 'Teknik Elektro', 'EE', 'Teknik_Elektro.jpg', '<figure class=\"image\"><img style=\"aspect-ratio:100%/auto;\" src=\"https://sp-ao.shortpixel.ai/client/to_webp,q_glossy,ret_img,w_960/https://www.pnp.ac.id/wp-content/uploads/2023/01/TEKNIK-ELEKTRO-2023.png\" width=\"100%\" height=\"auto\"></figure><h2><span style=\"color:hsl(0, 0%, 0%);font-family:Arial, Helvetica, sans-serif;\"><strong>Visi, Misi, Tujuan Dan Strategi</strong></span></h2><p><span style=\"color:hsl(0, 0%, 0%);font-family:Arial, Helvetica, sans-serif;\"><strong>Visi</strong></span></p><p style=\"text-align:center;\"><span style=\"color:hsl(0, 0%, 0%);font-family:Arial, Helvetica, sans-serif;\">Menjadi pusat pendidikan tinggi vokasional yang unggul dibidang teknik elektro yang mampu</span><br><span style=\"color:hsl(0, 0%, 0%);font-family:Arial, Helvetica, sans-serif;\">bersaing secara nasional dan internasional</span></p><p><span style=\"color:hsl(0, 0%, 0%);font-family:Arial, Helvetica, sans-serif;\"><strong>Misi</strong></span></p><p><span style=\"color:hsl(0, 0%, 0%);font-family:Arial, Helvetica, sans-serif;\">1. Menyelenggarakan pendidikan vokasi dibidang Teknik Elektro untuk menghasilkan&nbsp;lulusan yang bermutu, berakhlak, berjiwa wirausaha dan dapat bersaing diskala&nbsp;nasional dan Internasional.</span></p><p><span style=\"color:hsl(0, 0%, 0%);font-family:Arial, Helvetica, sans-serif;\">2. &nbsp;Mengembangkan ilmu pengetahuan dan teknologi terapan berbasis kebutuhan&nbsp;industri.</span></p><p><span style=\"color:hsl(0, 0%, 0%);font-family:Arial, Helvetica, sans-serif;\">&nbsp;3. &nbsp;Meningkatkan sistem manajemen mutu pendidikan di Jurusan Teknik Elektro.</span></p><p><span style=\"color:hsl(0, 0%, 0%);font-family:Arial, Helvetica, sans-serif;\">4. Mengimplementasikan Tridharma Perguruan Tinggi melalui pengembangan ilmu&nbsp;terapan di bidang &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; Teknik Elektro.</span></p><p><span style=\"color:hsl(0, 0%, 0%);font-family:Arial, Helvetica, sans-serif;\">5.Berpartisipasi aktif dalam kehidupan masyarakat Sumatera Barat di bidang Teknik&nbsp;Elektro.</span></p><p><span style=\"color:hsl(0, 0%, 0%);font-family:Arial, Helvetica, sans-serif;\"><strong>Tujuan</strong></span></p><ol><li><span style=\"color:hsl(0, 0%, 0%);font-family:Arial, Helvetica, sans-serif;\">Menjadi pusat pendidikan dan pengembangan ilmu pengetahuan dan teknologi terapan di bidang Teknik Elektro.</span></li><li><span style=\"color:hsl(0, 0%, 0%);font-family:Arial, Helvetica, sans-serif;\">Menghasilkan lulusan Diploma III dan Diploma IV Teknik Elektro yang berahlak mulia, berbudi luhur, berjiwa kewirausahaan dan mempunyai kemampuan serta keterampilan di bidang Teknik Elektro.</span></li><li><span style=\"color:hsl(0, 0%, 0%);font-family:Arial, Helvetica, sans-serif;\">Mempublikasikan hasil penelitian dan karya ilmiah ditingkat nasional maupun internasional.</span></li><li><span style=\"color:hsl(0, 0%, 0%);font-family:Arial, Helvetica, sans-serif;\">Menyediakan keahlian dan bantuan teknik, serta pendidikan dan pelatihan profesional melalui penerapan ilmu pengetahuan yang relevan dengan permasalahan bidang Teknik Elektro.</span></li><li><span style=\"color:hsl(0, 0%, 0%);font-family:Arial, Helvetica, sans-serif;\">Memberikan penyuluhan dan pelatihan dibidang teknik elektro kepada masyarakat</span></li></ol><p><span style=\"color:hsl(0, 0%, 0%);font-family:Arial, Helvetica, sans-serif;\"><strong>Sasaran</strong></span></p><p><span style=\"color:hsl(0, 0%, 0%);font-family:Arial, Helvetica, sans-serif;\">Tercapainya pelaksanaan Tri Dharma Perguruan Tinggi oleh dosen dan mahasiswa Jurusan Teknik Elektro untuk memenuhi kebutuhan masyarakat, perkembangan ilmu pengetahuan dan teknologi yang makin cepat didukung penuh seluruh civitas akademika.</span></p>', 'https://elektro.pnp.ac.id/', '2023-11-27 10:01:39', '2023-11-28 01:33:46'),
(11, 'Administrasi Niaga', 'AN', 'Administrasi_Niaga.jpg', '<figure class=\"image\"><img style=\"aspect-ratio:100%/auto;\" src=\"https://sp-ao.shortpixel.ai/client/to_webp,q_glossy,ret_img,w_960/https://www.pnp.ac.id/wp-content/uploads/2023/01/ADMINISTRASI-NIAGA-2023a.png\" width=\"100%\" height=\"auto\"></figure><p><strong>Jurusan Administrasi Niaga</strong></p><p>Jurusan Administrasi Niaga memiliki Program Studi D3 Administrasi Bisnis dan D3 Usaha Perjalanan Wisata</p><p><strong>1. Program Studi D.3 Administrasi Bisnis (Akreditasi B)</strong><br>Menghasilkan tenaga Ahli Madya profesional dalam bidang kesekretariatan dan administrasi perkantoran sesuai dengan kebutuhan dunia usaha dan dunia industri yang berkeahlian tinggi dalam menagani operasi perkantoran dan berwawasan konseptual yang baik untuk mengembangkan sistem perkantoran bisnis secara menyeluruh.</p><p><strong>Fasilitas Pendukung :</strong><br>• Labor Perkantoran<br>• Labor Pengetikan Manual<br>• Labor Pengetikan Elektric<br>• Labor Simulasi Bisnis<br>• Labor Komputer</p><p><strong>2. Program Studi D.3 Usaha Perjalanan Wisata (Akreditasi B)</strong><br>&nbsp;</p><p>Menghasilkan lulusan yang dalam merancang tour, baik inbound maupun outbond, melakukan reservasi dan dokumentasi tour, melakukan pemanduan (<i>guiding</i>) wisata.</p><p><strong>Fasilitas Pendukung :</strong><br>• Labor Ticketing<br>• Labor Simulasi Bisnis<br>• Labor Komputer<br>• Labor Bahasa<br>• Labor Pengetikan<br>• Labor Internet<br>• Bus Pariwisata</p><p><strong>3. Program Studi D4 Destinasi Pariwisata</strong></p><p>Menghasilkan lulusan yang handal sebagai Pengelola Objek dan daya tarik wisata (DMO), Tenaga ahli di konsultan pariwisata (peneliti muda, asisten peneliti, tenaga lapangan), Manager Sales dan Marketing Pariwisata, Event Organizer, Entrepreneur di Industri Pariwisata dan Hospitaliti, dan Peneliti di Bidang Pariwisata.</p>', 'http://an.pnp.ac.id/', '2023-11-27 10:09:01', '2023-11-27 10:44:14'),
(12, 'Akuntansi', 'AK', 'Akuntansi.jpg', '<figure class=\"image\"><img style=\"aspect-ratio:100%/auto;\" src=\"https://sp-ao.shortpixel.ai/client/to_webp,q_glossy,ret_img,w_960/https://www.pnp.ac.id/wp-content/uploads/2023/01/AKUNTANSI-2023.png\" width=\"100%\" height=\"auto\"></figure><p><strong>Jurusan Akuntansi</strong><br>Jurusan Akuntansi memiliki Program Studi DIV Akuntansi Perpajakan dan D3 Akuntansi</p><p><strong>1. Program Studi D.3 Akuntansi (Akreditasi UNGGUL)</strong><br>Menciptakan lulusan yang mampu dan terampil dalam bidang seperti: Asistant Accounting, Financial Computer System, Internal Auditor, Asistant Auditor, Asistant Analisis System, menghitung dan membuat laporan pajak</p><p><strong>2. Program Studi D.4 Akuntansi (Akreditasi A)</strong><br>Menghasilkan lulusan yang memiliki keahlian dan wawasan dibidang akuntansi, audit, pajak dan keuangan secara integrasi dan komprehensif yang bisa diterapkan pada perusahaan swasta, instansi pemerintah maupun lembaga keuangan baik berskala nasional maupun internasional.</p><p><strong>Fasilitas Pendukung Jurusan Akuntansi :</strong><br>• Labor Komputer Akuntasi<br>• Labor Praktek Akuntansi<br>• Labor Praktek Kerja Anggaran Manufaktur<br>• Labor Praktek Akuntansi Pemeriksaan<br>• Labor Anggaran<br>• Labor Sistem Informasi Akuntansi<br>• Labor Anggaran Bank Mini</p>', 'https://akuntansi.pnp.ac.id/', '2023-11-27 10:12:03', '2023-11-27 10:45:42'),
(13, 'Bahasa Inggris', 'BI', 'Bahasa_Inggris.jpg', '<figure class=\"image\"><img style=\"aspect-ratio:100%/auto;\" src=\"https://sp-ao.shortpixel.ai/client/to_webp,q_glossy,ret_img,w_960/https://www.pnp.ac.id/wp-content/uploads/2023/01/ENGLISH-DEPARTMENT-2023.png\" width=\"100%\" height=\"auto\"></figure><p><strong>Jurusan Bahasa Inggris</strong></p><p><br>Sebagai Jurusan Baru, Jurusan Bahasa Inggris memiliki Program Studi D3 Bahasa Inggris</p><p><strong>1. Program Studi D.3 Bahasa Inggris ( Akreditasi B)</strong><br>Menghasilkan lulusan yang memiliki kemampuan berfikir kritis, analitis dan memiliki rasa kepercayaan diri yang tinggi dan keterampilan berkomunikasi dalam bahasa Inggris dengan baik secara lisan dan tulisan untuk memenuhi kepentingan dunia usaha dan dunia industri, konsep, teknik dan keterampilan penerjemahan dari bahasa inggris ke bahasa indonesia dan sebaliknya,l serta keterampilan berbahasa inggris lisan dan tulisan dalm bidang komunikasi ( MC, Host, Spokesperson, News Reader, Reporter, Journalist,etc).</p><p><strong>Bidang Kerja :</strong><br>(Public Relation, Secretary, Receptionist, IT Operator, Telephone Operator, Tour Guide, Interpreter/ Translator, Customer Service, Travel Agent, Englisjh Course Owner and Instructor, MC, News Reader, Reporter, Journalist, Columnist, Host, Language Editor, Copy Writer, Movie Translator)</p><p><strong>Fasilitas Pendukung :</strong><br>• Computer and Multimedia based English<br>• Language Laboratory<br>• Computer and Multimedia based English Teaching<br>• English Club with Native Speakers<br>• Self Acces Center<br>• Library / Resources Centre<br>• Free Internet Acces (Hot Spot Areas)<br>• Studens Activity Centre</p><p>&nbsp;</p><p><strong>2. Program Studi D4 Bahasa Inggris untuk Komunikasi Bisnis dan Profesional</strong></p><p><strong>(</strong><i><strong>English for Business and Professional Communication</strong></i><strong>)</strong></p><p><strong>POLITEKNIK NEGERI PADANG</strong></p><p><strong>&nbsp;Profil dan Kompetensi lulusan:</strong></p><ol><li><strong>Penerjemah/juru bahasa (</strong><i><strong>translator/interpreter</strong></i><strong>) bidang bisnis.</strong></li></ol><p>Mampu menerjemahkan teks di bidang bisnis, ekonomi, dan hukum bisnis dari Bahasa Inggris ke Bahasa Indonesia dan sebaliknya, serta mampu menjadi Juru Bahasa dalam seminar bisnis dan rapat bisnis.</p><ol><li><strong>Wirausaha di bidang Bahasa Inggris</strong></li></ol><p>Mampu mengelola usaha di bidang Bahasa Inggris yaitu penerjemahan dan penjurubahasaan</p><ol><li><strong>Jurnalis media Berbahasa Inggris</strong></li></ol><p>Mampu menulis berita, menyunting berita, meliput berita dalam Bahasa Inggris, dan menyampaikan berita (<i>anchor, reporter, host</i>) dalam Bahasa Inggris, serta menerjemahkan berita dari Bahasa Inggris ke dalam Bahasa Indonesia dan sebaliknya dengan baik.</p><ol><li><i><strong>Communicator in creative industry</strong></i><strong> (</strong><i><strong>Content writer, Copy writer, Content editor</strong></i><strong>)</strong></li></ol><p>Mampu menulis konten, membuat konten, serta menyunting konten pada media komunikasi seperti TV, Radio dan Media Online dalam Bahasa Inggris dengan baik.</p><ol><li><i><strong>Public relation dan customer service officer</strong></i></li></ol><p>Mampu menjadi <i>Public Relation Officer</i> dan <i>Customer Service Officer</i> yang fasih berbahasa Inggris dan mampu menyajikan presentasi produk dan <i>service </i>yang dihasilkan perusahaan dalam Bahasa Inggris.</p><p>Peluang Kerja Lulusan:</p><ol><li>Perusahaan Nasional dan Multinasional.</li><li>Biro Penerjemahan.</li><li>Media Digital</li><li>Media Massa (Televisi &amp; Radio)</li><li>Industri Pariwisata</li></ol><p>Mata Kuliah Utama</p><ol><li>Writing for Professional Communication</li><li>Speaking for Professional Communication</li><li>Listening for Professional Communication</li><li>Reading for Professional Communication</li><li>Computer Application for Business and Professionals</li><li>Public Speaking for Professional Communication</li><li>Critical Reading</li><li>English for e-business</li><li>Business Document Translation</li><li>Business Correspondence</li><li>Translation for Media Communication</li><li>Intermediate Interpreting</li><li>Content Writing for Business and Professional Communication</li><li>Workshop on Communication in Creative Industry</li><li>Leadership Management</li></ol><p>Sarana Prasarana</p><ol><li>Laboratorium Bahasa</li><li>Laboratorium Multimedia</li><li>Laboratorium Translation</li><li>Studio Mini TV</li><li>Studio Mini Radio</li></ol><p>Sitim pendidikan:</p><p>Perkuliahn diberikan dengan metode pembelajaran Blended Learning dengan presentase 60 % praktek dan 40% teori.</p><p>Perkuliahan diampu oleh dosen tetap dari jurusan Bahasa Inggris PNP dan para praktisi dari industri.</p>', 'https://bing.pnp.ac.id/', '2023-11-27 10:16:21', '2023-11-27 10:48:56'),
(14, 'Teknologi Informasi', 'TI', 'Teknologi_Informasi.png', '<figure class=\"image\"><img style=\"aspect-ratio:100%/auto;\" src=\"https://sp-ao.shortpixel.ai/client/to_webp,q_glossy,ret_img,w_960/https://www.pnp.ac.id/wp-content/uploads/2023/01/Teknologi-Informasi-2023.png\" width=\"100%\" height=\"auto\"></figure><p><strong>Jurusan Teknologi Informasi</strong><br>Menghasilkan tenaga professional tingkat ahli madya di bidang Teknologi Informasi, khususnya pengelolaan informasi berbasis komputer sehingga mampu bekerja di berbagai instansi, perkantoran organisasi dan bisnis modern.</p><p><strong>1. Program Studi Teknik Komputer D3 (Akreditasi B)</strong><br>Memiliki kemampuan membangun jaringan komputer internet dan intranet. Mampu memilih model dan infra struktur jaringan untuk berbagai keperluan yang berbeda. Mampu melakukan perawatan, perbaikan sistem jaringan komputer. Mampu menjadi administrator dan programmer.</p><p><strong>Fasilitas Pendukung :</strong><br>• Lab. Komputer<br>• Lab. Jaringan<br>• Bengkel Komputer<br>• Lab. Basis Data<br>•Lab. Digital</p><p><strong>2. Program Studi Manajemen Informatika D3 (Akreditasi B)</strong><br>Memiliki kemampuan membuat aplikasi jaringan komputer internet dan intranet dan mengelola sistem informasi berbasis LAN (Local Area Network) dan Internet untuk berbagai organisasi perkantoran dan bisnis. Menguasai berbagai program aplikasi (programmer)</p><p><strong>Fasilitas Pendukung :</strong><br>• Lab. Pemrograman<br>• Lab. Komputer<br>• Lab. Jaringan<br>• Lab. Basis Data<br>• Lab. Digital<br>• Lab. Pemrograman</p><p><strong>3. Program Studi D4 Teknologi Rekayasa Perangkat Lunak ( Akreditasi BAIK )</strong><br>Memiliki kemampuan membangun jaringan komputer internet dan intranet dan membuat aplikasi dan mengelola sistem informasi berbasis LAN (Local Area Network) dan Internet untuk berbagai organisasi perkantoran dan bisnis. Menguasai berbagai program aplikasi (programmer)</p><p><strong>Fasilitas Pendukung :</strong><br>• Lab. Pemograman<br>• Lab. Komputer<br>• Lab. Jaringan<br>• Lab. Basis Data<br>• Lab. Digital<br>• Lab. Pemrograman</p>', 'https://ti.pnp.ac.id/', '2023-11-27 10:20:07', '2023-11-27 10:50:29');

