;a:2:{s:5:\"nilai\";i:-214;s:9:\"peringkat\";i:25;}}', '3EL', 'a:9:{s:2:\"id\";i:24;s:10:\"id_jurusan\";i:10;s:4:\"kode\";s:3:\"3EL\";s:4:\"nama\";s:17:\"D3 Teknik Listrik\";s:10:\"akreditasi\";s:15:\"B / Baik Sekali\";s:9:\"deskripsi\";s:2692:\"<p><span style=\"color:hsl(0, 0%, 0%);\"><strong>Program Studi D.3 Teknik Listrik</strong></span></p><p><span style=\"color:hsl(0, 0%, 0%);\">Berorientasi dalam bidang penerapan tentang instalasi penerangan dan tenaga, teknologi pembangkit. Sistem distribusi listrik, perawatan/ perbaikan mesin – mesin industri serta perancangan dan pengembangan teknik instrumentasi dan kontrol industri.</span></p><p><span style=\"color:hsl(0, 0%, 0%);\"><strong>Visi program studi</strong></span></p><p><span style=\"color:hsl(0, 0%, 0%);\">Menjadi pusat pendidikan, pelatihan dan pengembangan ilmu terapan bidang ketenagalistrikan yang terkemuka di wilayah Indonesia bagian Barat pada tahun 2014.</span></p><p><span style=\"color:hsl(0, 0%, 0%);\"><strong>Misi program studi</strong></span></p><p><span style=\"color:hsl(0, 0%, 0%);\">&nbsp; &nbsp; &nbsp; 1. Meningkatkan&nbsp; sistem manajemen mutu pendidikan di&nbsp; PSTL.</span></p><ol><li><span style=\"color:hsl(0, 0%, 0%);\">Mengembangkan ilmu terapan dibidang ketenagalistrikan yang bermanfaat bagi masyarakat.</span></li><li><span style=\"color:hsl(0, 0%, 0%);\">Menghasilkan lulusan vokasional di bidang ketenagalistrikkan yang mampu bersaing dan menciptakan lapangan pekerjaan sendiri.</span></li><li><span style=\"color:hsl(0, 0%, 0%);\">Mengembangkan hubungan kerjasama dengan industri dan institusi terkait.</span></li></ol><p><span style=\"color:hsl(0, 0%, 0%);\"><strong>Tujuan program studi</strong></span></p><p><span style=\"color:hsl(0, 0%, 0%);\">Menghasilkan lulusan vokasional di bidang ketenagalistrikan yang cerdas, berdayasaing tinggi, mandiri dan bermartabat dengan meningkatkan sistem manajemen mutu pendidikan di PSTL, mengembangkan ilmu terapan dibidang ketenagalistrikan yang bermanfaat bagi masyarakat dan meningkatkan kerjasama dengan industri dan institusi terkait.</span></p><p><span style=\"color:hsl(0, 0%, 0%);\"><strong>Fasilitas Pendukung Program Studi D3 Teknik Listrik :</strong></span></p><ul><li><span style=\"color:hsl(0, 0%, 0%);\">Labor PLC</span></li><li><span style=\"color:hsl(0, 0%, 0%);\">Labor Listrik Dasar</span></li><li><span style=\"color:hsl(0, 0%, 0%);\">Labor Elektronika Daya</span></li><li><span style=\"color:hsl(0, 0%, 0%);\">Labor Rancangan Listrik</span></li><li><span style=\"color:hsl(0, 0%, 0%);\">Labor Jaringan Tegangan Listrik</span></li><li><span style=\"color:hsl(0, 0%, 0%);\">Labor Instrumentasi &amp; Sistem Kendali</span></li><li><span style=\"color:hsl(0, 0%, 0%);\">Labor Komputer</span></li><li><span style=\"color:hsl(0, 0%, 0%);\">Bengkel Kerja Mekanik</span></li><li><span style=\"color:hsl(0, 0%, 0%);\">Bengkel Instalasi Listrik</span></li><li><span style=\"color:hsl(0, 0%, 0%);\">Labor PLTMH</span></li></ul>\";s:4:\"logo\";s:21:\"D3_Teknik_Listrik.jpg\";s:10:\"created_at\";s:27:\"2023-11-28T08:35:07.000000Z\";s:10:\"updated_at\";s:27:\"2023-11-28T08:49:27.000000Z\";}', 'a:8:{s:2:\"id\";i:10;s:4:\"nama\";s:14:\"Teknik Elektro\";s:4:\"kode\";s:2:\"EE\";s:4:\"logo\";s:18:\"Teknik_Elektro.jpg\";s:9:\"deskripsi\";s:3688:\"<figure class=\"image\"><img style=\"aspect-ratio:100%/auto;\" src=\"https://sp-ao.shortpixel.ai/client/to_webp,q_glossy,ret_img,w_960/https://www.pnp.ac.id/wp-content/uploads/2023/01/TEKNIK-ELEKTRO-2023.png\" width=\"100%\" height=\"auto\"></figure><h2><span style=\"color:hsl(0, 0%, 0%);font-family:Arial, Helvetica, sans-serif;\"><strong>Visi, Misi, Tujuan Dan Strategi</strong></span></h2><p><span style=\"color:hsl(0, 0%, 0%);font-family:Arial, Helvetica, sans-serif;\"><strong>Visi</strong></span></p><p style=\"text-align:center;\"><span style=\"color:hsl(0, 0%, 0%);font-family:Arial, Helvetica, sans-serif;\">Menjadi pusat pendidikan tinggi vokasional yang unggul dibidang teknik elektro yang mampu</span><br><span style=\"color:hsl(0, 0%, 0%);font-family:Arial, Helvetica, sans-serif;\">bersaing secara nasional dan internasional</span></p><p><span style=\"color:hsl(0, 0%, 0%);font-family:Arial, Helvetica, sans-serif;\"><strong>Misi</strong></span></p><p><span style=\"color:hsl(0, 0%, 0%);font-family:Arial, Helvetica, sans-serif;\">1. Menyelenggarakan pendidikan vokasi dibidang Teknik Elektro untuk menghasilkan&nbsp;lulusan yang bermutu, berakhlak, berjiwa wirausaha dan dapat bersaing diskala&nbsp;nasional dan Internasional.</span></p><p><span style=\"color:hsl(0, 0%, 0%);font-family:Arial, Helvetica, sans-serif;\">2. &nbsp;Mengembangkan ilmu pengetahuan dan teknologi terapan berbasis kebutuhan&nbsp;industri.</span></p><p><span style=\"color:hsl(0, 0%, 0%);font-family:Arial, Helvetica, sans-serif;\">&nbsp;3. &nbsp;Meningkatkan sistem manajemen mutu pendidikan di Jurusan Teknik Elektro.</span></p><p><span style=\"color:hsl(0, 0%, 0%);font-family:Arial, Helvetica, sans-serif;\">4. Mengimplementasikan Tridharma Perguruan Tinggi melalui pengembangan ilmu&nbsp;terapan di bidang &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; Teknik Elektro.</span></p><p><span style=\"color:hsl(0, 0%, 0%);font-family:Arial, Helvetica, sans-serif;\">5.Berpartisipasi aktif dalam kehidupan masyarakat Sumatera Barat di bidang Teknik&nbsp;Elektro.</span></p><p><span style=\"color:hsl(0, 0%, 0%);font-family:Arial, Helvetica, sans-serif;\"><strong>Tujuan</strong></span></p><ol><li><span style=\"color:hsl(0, 0%, 0%);font-family:Arial, Helvetica, sans-serif;\">Menjadi pusat pendidikan dan pengembangan ilmu pengetahuan dan teknologi terapan di bidang Teknik Elektro.</span></li><li><span style=\"color:hsl(0, 0%, 0%);font-family:Arial, Helvetica, sans-serif;\">Menghasilkan lulusan Diploma III dan Diploma IV Teknik Elektro yang berahlak mulia, berbudi luhur, berjiwa kewirausahaan dan mempunyai kemampuan serta keterampilan di bidang Teknik Elektro.</span></li><li><span style=\"color:hsl(0, 0%, 0%);font-family:Arial, Helvetica, sans-serif;\">Mempublikasikan hasil penelitian dan karya ilmiah ditingkat nasional maupun internasional.</span></li><li><span style=\"color:hsl(0, 0%, 0%);font-family:Arial, Helvetica, sans-serif;\">Menyediakan keahlian dan bantuan teknik, serta pendidikan dan pelatihan profesional melalui penerapan ilmu pengetahuan yang relevan dengan permasalahan bidang Teknik Elektro.</span></li><li><span style=\"color:hsl(0, 0%, 0%);font-family:Arial, Helvetica, sans-serif;\">Memberikan penyuluhan dan pelatihan dibidang teknik elektro kepada masyarakat</span></li></ol><p><span style=\"color:hsl(0, 0%, 0%);font-family:Arial, Helvetica, sans-serif;\"><strong>Sasaran</strong></span></p><p><span style=\"color:hsl(0, 0%, 0%);font-family:Arial, Helvetica, sans-serif;\">Tercapainya pelaksanaan Tri Dharma Perguruan Tinggi oleh dosen dan mahasiswa Jurusan Teknik Elektro untuk memenuhi kebutuhan masyarakat, perkembangan ilmu pengetahuan dan teknologi yang makin cepat didukung penuh seluruh civitas akademika.</span></p>\";s:7:\"website\";s:26:\"https://elektro.pnp.ac.id/\";s:10:\"created_at\";s:27:\"2023-11-27T17:01:39.000000Z\";s:10:\"updated_at\";s:27:\"2023-11-28T08:33:46.000000Z\";}', 'a:7:{i:6;a:2:{s:4:\"kode\";s:2:\"ME\";s:4:\"nama\";s:12:\"Teknik Mesin\";}i:9;a:2:{s:4:\"kode\";s:2:\"SP\";s:4:\"nama\";s:12:\"Teknik Sipil\";}i:10;a:2:{s:4:\"kode\";s:2:\"EE\";s:4:\"nama\";s:14:\"Teknik Elektro\";}i:11;a:2:{s:4:\"kode\";s:2:\"AN\";s:4:\"nama\";s:18:\"Administrasi Niaga\";}i:12;a:2:{s:4:\"kode\";s:2:\"AK\";s:4:\"nama\";s:9:\"Akuntansi\";}i:13;a:2:{s:4:\"kode\";s:2:\"BI\";s:4:\"nama\";s:14:\"Bahasa Inggris\";}i:14;a:2:{s:4:\"kode\";s:2:\"TI\";s:4:\"nama\";s:19:\"Teknologi Informasi\";}}', 'a:25:{s:4:\"3TAB\";a:2:{s:4:\"nama\";s:20:\"D3 Teknik Alat Berat\";s:10:\"id_jurusan\";i:6;}s:3:\"3ME\";a:2:{s:4:\"nama\";s:15:\"D3 Teknik Mesin\";s:10:\"id_jurusan\";i:6;}s:5:\"4TMAN\";a:2:{s:4:\"nama\";s:20:\"D4 Teknik Manufaktur\";s:10:\"id_jurusan\";i:6;}s:4:\"4RPM\";a:2:{s:4:\"