INSERT INTO `prodis` (`id`, `id_jurusan`, `kode`, `nama`, `akreditasi`, `deskripsi`, `logo`, `created_at`, `updated_at`) VALUES
(15, 6, '3TAB', 'D3 Teknik Alat Berat', 'B / Baik Sekali', '<h2><span style=\"color:hsl(0,0%,0%);\"><strong>D3 Teknik Alat Berat</strong></span></h2><h2><span style=\"color:hsl(0,0%,0%);\"><strong>Visi</strong></span></h2><p><span style=\"color:hsl(0,0%,0%);\">Menjadi program studi pendidikan vokasi unggul di bidang perawatan Teknik Alat Berat pada tahun 2022</span></p><h2><span style=\"color:hsl(0,0%,0%);\"><strong>Misi</strong></span></h2><ol><li><span style=\"color:hsl(0,0%,0%);\">Menyelenggarakan pendidikan tinggi vokasional yang berbasis karakter untuk menghasilkan sumber daya manusia mandiri yang berkualitas demi kemakmuran bangsa.</span></li><li><span style=\"color:hsl(0,0%,0%);\">Menyelenggarakan pendidikan dan pelatihan bidang keahlian alat berat.</span></li><li><span style=\"color:hsl(0,0%,0%);\">Menciptakan lingkungan dan atmosfer akademik yang berkualitas dengan sistem manajemen yang profesional.</span></li><li><span style=\"color:hsl(0,0%,0%);\">Melaksanakan tridarma perguruan tinggi melalui pengembangan ilmu pengetahuan dan teknologi terapan.</span></li></ol><h2><span style=\"color:hsl(0,0%,0%);\"><strong>Tujuan</strong></span></h2><ol><li><span style=\"color:hsl(0,0%,0%);\">Untuk menghasilkan lulusan yang berkualitas dan profesional bidang Teknik Alat Berat yang kompetitif di pasar kerja dengan kompetensi teknisi setingkat level “Technician”</span></li><li><span style=\"color:hsl(0,0%,0%);\">Memiliki dasar-dasar ilmu keteknikan dan alat berat serta mampu bekerja dengan mengunakan <i>workshop tools</i> dan <i>workshop equipment</i> dengan benar dan aman sesuai dengan <i>service literature</i></span></li><li><span style=\"color:hsl(0,0%,0%);\">Mampu membongkar pasang dan mengidentifikasi komponen-komponen serta alat berat yang meliputi engine, sistem hidraulik, sistem elektrik, power train dan <i>undercarriage</i></span></li><li><span style=\"color:hsl(0,0%,0%);\">Mampu melakukan pengetesan dan penyetelan pada komponen-komponen alat berat serta memiliki kemampuan dasar dalam <i>problem solving</i>, troubleshooting dan analisa kegagalan</span></li><li><span style=\"color:hsl(0,0%,0%);\">Memiliki karakter produktif yang berakhlak mulia</span></li><li><span style=\"color:hsl(0,0%,0%);\">Mempunyai kemampuan mendorong dirinya berprestasi dan mengembangkan karir lebih lanjut ke jenjang yang lebih tinggi.</span></li></ol><h2><span style=\"color:hsl(0,0%,0%);\"><strong>Sasaran dan Strategi Pencapaian</strong></span></h2><ol><li><span style=\"color:hsl(0,0%,0%);\">Peningkatan atmosfir akademis dengan organisasi sistem kependidikan yang baik dan layanan manajemen yang berkualitas.</span></li><li><span style=\"color:hsl(0,0%,0%);\">Peningkatan kualitas kurikulum melalui Rencana Pembelajaran Semester (RPS) &nbsp;dan kontrak Pembelajaran yang sesuai dengan perkembangan ilmu pengetahuan dan teknologi di bidang alat berat</span></li><li><span style=\"color:hsl(0,0%,0%);\">Terbentuknya kelompok bidang keahlian dan mengajar (<i>team teaching)</i> untuk melakukan perubahan pengembangan materi ajar yang tertuang dalam RPS dan Kontrak Pembelajaran yang sesuai dengan perkembangan ilmu pengetahuan dan teknologi alat berat</span></li><li><span style=\"color:hsl(0,0%,0%);\">Peningkatan pengetahuan dan kemampuan kompetensi lulusan dan daya serap pasar kerja</span></li><li><span style=\"color:hsl(0,0%,0%);\">Peningkatan hubungan kerjasama dengan industri dan instansi terkait di bidang teknik alat berat</span></li></ol><h2><span style=\"color:hsl(0,0%,0%);\">Fasilitas Pendukung</span></h2><ol><li><span style=\"color:rgb(51,51,51);\">Excavator</span></li><li><span style=\"color:rgb(51,51,51);\">Buldozer</span></li><li><span style=\"color:rgb(51,51,51);\">Laboratorium Pengujian Bahan</span></li><li><span style=\"color:rgb(51,51,51);\">Workshop Produksi</span></li><li><span style=\"color:rgb(51,51,51);\">Workshop Perawatan &amp; Perbaikan</span></li><li><span style=\"color:rgb(51,51,51);\">Laboratorium CNC</span></li><li><span style=\"color:rgb(51,51,51);\">Laboratorium Komputer</span></li><li><span style=\"color:rgb(51,51,51);\">Studio Gambar dan Perancangan</span></li><li><span style=\"color:rgb(51,51,51);\">Laboratorium Refrigerasi &amp; Pengkondisian Udara</span></li></ol>', 'D3_Teknik_Alat_Berat.jpg', '2023-11-28 00:15:10', '2023-11-28 00:44:40'),
(16, 6, '3ME', 'D3 Teknik Mesin', 'B / Baik Sekali', '<h2><span style=\"color:hsl(0,0%,0%);\"><strong>D3 Teknik Mesin</strong></span></h2><h2><span style=\"color:hsl(0,0%,0%);\"><strong>Visi</strong></span></h2><p><span style=\"color:hsl(0,0%,0%);\">Menjadi program studi pendidikan vokasi yang unggul di bidang Teknik Mesin</span><br><span style=\"color:hsl(0,0%,0%);\">yang bermartabat, profesional, memiliki integritas dan berdaya saing</span><br><span style=\"color:hsl(0,0%,0%);\">internasional.</span></p><h2><span style=\"color:hsl(0,0%,0%);\"><strong>Misi</strong></span></h2><ol><li><span style=\"color:hsl(0,0%,0%);\">Menyelenggarakan kegiatan pendidikan vokasi yang kreatif dan inovatif</span><br><span style=\"color:hsl(0,0%,0%);\">guna menghasilkan lulusan Teknik Mesin di bidang produksi</span><br><span style=\"color:hsl(0,0%,0%);\">pemesinan, perawatan mesin-mesin dan otomasi yang mampu</span><br><span style=\"color:hsl(0,0%,0%);\">bersaing di tingkat nasional dan internasional.</span></li><li><span style=\"color:hsl(0,0%,0%);\">Menyelenggarakan kegiatan penelitian yang dapat memberikan</span><br><span style=\"color:hsl(0,0%,0%);\">sumbangan terhadap perkembangan ilmu pengetahuan dan teknologi.</span></li><li><span style=\"color:hsl(0,0%,0%);\">Melaksanakan kegiatan pengabdian kepada masyarakat guna</span><br><span style=\"color:hsl(0,0%,0%);\">mengimplementasikan ilmu teknik mesin.</span></li><li><span style=\"color:hsl(0,0%,0%);\">Menjalin kerjasama dengan industri, lembaga dan institusi terkait untuk</span><br><span style=\"color:hsl(0,0%,0%);\">memperluas jaringan dan informasi teknologi terbaru.</span></li><li><span style=\"color:hsl(0,0%,0%);\">Melaksanakan tata kelola dan pelayanan Program Studi yang</span><br><span style=\"color:hsl(0,0%,0%);\">berkualitas untuk menunjang Tridharma Perguruan Tinggi melalui</span><br><span style=\"color:hsl(0,0%,0%);\">implementasi sistem penjaminan mutu.</span></li></ol><h2><span style=\"color:hsl(0,0%,0%);\"><strong>Tujuan</strong></span></h2><ol><li><span style=\"color:hsl(0,0%,0%);\">Menghasilkan sumber daya manusia yang berakhlak baik serta mampu</span><br><span style=\"color:hsl(0,0%,0%);\">mengembangkan diri secara berkesinambungan.</span></li><li><span style=\"color:hsl(0,0%,0%);\">Menghasilkan lulusan D3 Teknik Mesin di bidang produksi pemesinan,</span><br><span style=\"color:hsl(0,0%,0%);\">perawatan mesin-mesin dan otomasi yang kompeten mengacu kepada</span><br><span style=\"color:hsl(0,0%,0%);\">standar KKNI, dan mampu bersaing di tingkat nasional dan</span><br><span style=\"color:hsl(0,0%,0%);\">internasional.</span></li><li><span style=\"color:hsl(0,0%,0%);\">Berperan aktif dalam mengembangkan pengetahuan teknik mesin</span><br><span style=\"color:hsl(0,0%,0%);\">melalui penelitian dan pengabdian kepada masyarakat yang berdaya</span><br><span style=\"color:hsl(0,0%,0%);\">guna yang diintegrasikan dengan pendidikan.</span></li><li><span style=\"color:hsl(0,0%,0%);\">Meningkatkan dan memperluas kerjasama dengan industri, lembaga</span><br><span style=\"color:hsl(0,0%,0%);\">dan institusi terkait untuk memperluas jaringan dan informasi teknologi</span><br><span style=\"color:hsl(0,0%,0%);\">guna menunjang Tridharma Perguruan Tinggi.</span></li><li><span style=\"color:hsl(0,0%,0%);\">Meningkatkan kualitas tata kelola Program Studi untuk menunjang Tridharma Perguruan Tinggi melalui implementasi sistem penjaminan mutu.</span></li></ol><h2><span style=\"color:hsl(0,0%,0%);\">Fasilitas Pendukung</span></h2><ol><li><span style=\"color:hsl(0,0%,0%);\">Labor Komputer</span></li><li><span style=\"color:hsl(0,0%,0%);\">Labor CNC</span></li><li><span style=\"color:hsl(0,0%,0%);\">Labor Pneumatik Hidrolik</span></li><li><span style=\"color:hsl(0,0%,0%);\">Labor Maintenance</span></li><li><span style=\"color:hsl(0,0%,0%);\">Labor Produksi</span></li><li><span style=\"color:hsl(0,0%,0%);\">Labor Pengujian Bahan &amp; Metrologi</span></li><li><span style=\"color:hsl(0,0%,0%);\">Labor Mekanika Fluida &amp; Hidrolika</span></li><li><span style=\"color:hsl(0,0%,0%);\">Bengkel Las</span></li><li><span style=\"color:hsl(0,0%,0%);\">Bengkel Bubut</span></li><li><span style=\"color:hsl(0,0%,0%);\">Bengkel Miling</span></li><li><span style=\"color:hsl(0,0%,0%);\">Bengkel Grinding/gerinda</span></li><li><span style=\"color:hsl(0,0%,0%);\">Bengkel Sheet Metal</span></li></ol>', 'D3_Teknik_Mesin.jpg', '2023-11-28 00:17:43', '2023-11-28 01:21:58'),
(17, 6, '4TMAN', 'D4 Teknik Manufaktur', 'B / Baik Sekali', '<h2><span style=\"color:hsl(0,0%,0%);\"><strong>D4 Teknik Manufaktur</strong></span></h2><h2><span style=\"color:hsl(0,0%,0%);\"><strong>Visi</strong></span></h2><p><span style=\"color:hsl(0,0%,0%);\">Menjadi Pusat Unggulan Teknologi Manufaktur</span></p><h2><span style=\"color:hsl(0,0%,0%);\"><strong>Misi</strong></span></h2><ol><li><span style=\"color:hsl(0,0%,0%);\">Mengembangkan kemampuan Sumber Daya Manusia dalam bidang Teknologi Manufaktur</span></li><li><span style=\"color:hsl(0,0%,0%);\">Mengembangkan Inovasi Teknologi Manufaktur</span></li></ol><h2><span style=\"color:hsl(0,0%,0%);\"><strong>Tujuan</strong></span></h2><ol><li><span style=\"color:hsl(0,0%,0%);\">Memperkuat kompetensi Sumber Daya Manusia Program Studi Teknik Manufaktur.</span></li><li><span style=\"color:hsl(0,0%,0%);\">Menghasilkan tenaga kerja yang mempunyai keahlian dalam bidang Teknik Manufaktur.</span></li><li><span style=\"color:hsl(0,0%,0%);\">Mengembangkan Ilmu Pengetahuan dan Teknologi.</span></li><li><span style=\"color:hsl(0,0%,0%);\">Meningkatkan mutu pendidikan.</span></li></ol><h2><span style=\"color:hsl(0,0%,0%);\"><strong>Fasilitas Pendukung</strong></span></h2><ol><li><span style=\"color:hsl(0,0%,0%);\">Labor Produksi</span></li><li><span style=\"color:hsl(0,0%,0%);\">Labor Maintenance</span></li><li><span style=\"color:hsl(0,0%,0%);\">Labor Komputer</span></li><li><span style=\"color:hsl(0,0%,0%);\">Labor Pengujian Bahan dan Metrologi</span></li><li><span style=\"color:hsl(0,0%,0%);\">Labor Fluida dan Hidrolika</span></li><li><span style=\"color:hsl(0,0%,0%);\">Bengkel Grinding/Gerinda</span></li><li><span style=\"color:hsl(0,0%,0%);\">Bengkel Milling</span></li></ol>', 'D4_Teknik_Manufaktur.jpg', '2023-11-28 00:20:59', '2023-11-28 00:49:28'),
(18, 6, '4RPM', 'D4 Rekayasa Perancangan Mekanik', '- / Proses Akreditasi', '<h2><span style=\"color:hsl(0, 0%, 0%);\"><strong>D4 Rekayasa Perancangan Mekanik</strong></span></h2><h2><span style=\"color:hsl(0, 0%, 0%);\"><strong>VISI</strong></span></h2><p><span style=\"color:hsl(0, 0%, 0%);\">Menjadi program studi pelopor dan unggul dalam bidang perancangan mesin yang dibekali dengan tindakan <i>maintenance and repair of industrial machinery dan softskill.</i></span></p><h2><span style=\"color:hsl(0, 0%, 0%);\"><strong>MISI</strong></span></h2><ol><li><span style=\"color:hsl(0, 0%, 0%);\">Menyelenggarakan pendidikan untuk mempersiapkan lulusan yang menguasai konsep perancangan komponen mesin dengan memperhatikan spesifikasi, konsep rancangan, optimasi, <i>ergonomic, </i>dokumentasi, <i>prototype, </i>dan uji coba yang berdaya saing global.</span></li><li><span style=\"color:hsl(0, 0%, 0%);\">Melakukan penelitian yang sebagai upaya pemecahan permasalahan dalam bidang vokasi dan masyarakat yang berkaitan dengan bidang perancangan mesin untuk menunjang pembangunan nasional.</span></li><li><span style=\"color:hsl(0, 0%, 0%);\">Melakukan upaya untuk memberikan layanan kepada masyarakat, lembaga perusahaan berskala kecil, menengah dan besar dalam bidang perancangan mesin</span></li></ol><h2><span style=\"color:hsl(0, 0%, 0%);\"><strong>TUJUAN</strong></span></h2><ol><li><span style=\"color:hsl(0, 0%, 0%);\">Menghasilkan lulusan yang memiliki daya saing tinggi</span></li><li><span style=\"color:hsl(0, 0%, 0%);\">Menghasilkan sumber daya yang memiliki jiwa yang nasionalis, profesional, berjiwa <i>entrepreneur </i>dan berwawasan internasional.</span></li><li><span style=\"color:hsl(0, 0%, 0%);\">Menghasilkan karya cipta yan sesuai kebutuhan industri dan masyarakat nasional dan internasional</span></li><li><span style=\"color:hsl(0, 0%, 0%);\">Terwujudnya konseo <i>link and match </i>melalui kerjasama dengan industri, masyarakat dan pemerintah.</span></li></ol><h2><span style=\"color:hsl(0, 0%, 0%);\">FASILITAS PENDUKUNG</span></h2><ol><li><span style=\"color:hsl(0, 0%, 0%);\">Labor Komputer</span></li><li><span style=\"color:hsl(0, 0%, 0%);\">Labor CNC</span></li><li><span style=\"color:hsl(0, 0%, 0%);\">Labor Pneumatik Hidrolik</span></li><li><span style=\"color:hsl(0, 0%, 0%);\">Labor Maintenance</span></li><li><span style=\"color:hsl(0, 0%, 0%);\">Labor Produksi</span></li><li><span style=\"color:hsl(0, 0%, 0%);\">Labor Pengujian Bahan &amp; Metrologi</span></li><li><span style=\"color:hsl(0, 0%, 0%);\">Labor Mekanika Fluida &amp; Hidrolika</span></li><li><span style=\"color:hsl(0, 0%, 0%);\">Bengkel las</span></li><li><span style=\"color:hsl(0, 0%, 0%);\">Bengkel bubut</span></li><li><span style=\"color:hsl(0, 0%, 0%);\">Bengkel miling</span></li><li><span style=\"color:hsl(0, 0%, 0%);\">Bengkel grinding/gerinda</span></li><li><span style=\"color:hsl(0, 0%, 0%);\">Bengkel sheet Metal</span></li></ol>', 'D4_Rekayasa_Perancangan_Mekanik.jpg', '2023-11-28 00:23:05', '2023-11-28 00:53:11'),
(19, 9, '3SP', 'D3 Teknik Sipil', 'A / Unggul', '<h2><span style=\"color:hsl(0, 0%, 0%);\"><strong>Program Studi D3 Teknik Sipil (Akreditasi A)</strong></span></h2><h3><span style=\"color:hsl(0, 0%, 0%);\"><strong>a. Konsentrasi Konstruksi Sipil</strong></span></h3><p><span style=\"color:hsl(0, 0%, 0%);\">Memusatkan keahlian pada pekerjaan sipil dalam segala kaitannya dengan masalah perencanaan struktur, pelaksanaan dan pengawasan bangunan gedung.</span><br><span style=\"color:hsl(0, 0%, 0%);\">Memusatkan keahlian pada pekerjaan sipil dalam segala kaitanya dengan masalah perencanaan, pembangunan, perlengkapan, perawatan dan perbaikan bangunan sipil non gedung seperti jalan raya, jembatan, dll.</span></p><h3><span style=\"color:hsl(0, 0%, 0%);\"><strong>b. Konsentrasi Konstruksi Bangunan Gedung</strong></span></h3><p><span style=\"color:hsl(0, 0%, 0%);\">Memusatkan keahlian pada pekerjaan sipil dalam segala kaitannya dengan masalah perencanaan, pembangunan, perlengkapan, bangunan</span></p><h3><span style=\"color:hsl(0, 0%, 0%);\"><strong>Fasilitas Pendukung</strong></span></h3><ol><li><span style=\"color:hsl(0, 0%, 0%);\">Labor Material</span></li><li><span style=\"color:hsl(0, 0%, 0%);\">Labor Hidrolika</span></li><li><span style=\"color:hsl(0, 0%, 0%);\">Labor Mekanika Tanah</span></li><li><span style=\"color:hsl(0, 0%, 0%);\">Labor Struktur</span></li><li><span style=\"color:hsl(0, 0%, 0%);\">Labor Ilmu Ukur Tanah</span></li><li><span style=\"color:hsl(0, 0%, 0%);\">Labor komputer</span></li><li><span style=\"color:hsl(0, 0%, 0%);\">Bengkel Kayu</span></li><li><span style=\"color:hsl(0, 0%, 0%);\">Bengkel Baja</span></li><li><span style=\"color:hsl(0, 0%, 0%);\">Bengkel Plumbing</span></li><li><span style=\"color:hsl(0, 0%, 0%);\">Bengkel Beton</span></li><li><span style=\"color:hsl(0, 0%, 0%);\">Bengkel Tepat guna</span></li><li><span style=\"color:hsl(0, 0%, 0%);\">Bengkel Acuan Perancah</span></li><li><span style=\"color:hsl(0, 0%, 0%);\">Bengkel Drainage</span></li><li><span style=\"color:hsl(0, 0%, 0%);\">Bengkel Batu</span></li></ol>', 'D3_Teknik_Sipil.jpg', '2023-11-28 01:10:42', '2023-11-28 01:10:42'),
(20, 9, '4MRK', 'D4 Manajemen Rekayasa Konstruksi', 'B / Baik Sekali', '<h2><span style=\"color:hsl(0, 0%, 0%);\"><strong>Program Studi D4 Manajemen Rekayasa Konstruksi (Akreditasi B)</strong></span></h2><p>&nbsp;</p><p><span style=\"color:hsl(0, 0%, 0%);\">Menghasilkan tenaga profesional di bidang manajerial khususnya pada proyek konstruksi dan mampu menyusun tahapan-tahapan perwujudan proyek konstruksi, yang dimulai dari tahap penyusunan ide, studi kelayakan, perencanaan/perancangan, hingga tahap pelaksanaan (termasuk pengawasan pelaksanaannya) serta penggunaan dari suatu proyek konstruksi. Melahirkan tenaga manajemen rekayasa konstruksi yang profesional, yang mampu mengidentifikasi, menganalisis, pengawasan, dan pengendalian terhadap risiko dari suatu pengambilan keputusan pada proyek konstruksi serta melahirkan tenaga manajemen rekayasa konstruksi yang mampu melakukan pengawasan dan pengendalian serta memberikan jaminan mutu (Quality Assurance) terhadap mutu pekerjaan suatu proyek konstruksi.</span></p><p><br><span style=\"color:hsl(0, 0%, 0%);\">Fasilitas Pendukung :</span><br><span style=\"color:hsl(0, 0%, 0%);\">• Labor Material</span><br><span style=\"color:hsl(0, 0%, 0%);\">• Labor Hidrolika</span><br><span style=\"color:hsl(0, 0%, 0%);\">• Labor Mekanika Tanah</span><br><span style=\"color:hsl(0, 0%, 0%);\">• Labor Stuktur</span><br><span style=\"color:hsl(0, 0%, 0%);\">• Labor Ilmu Ukur Tanah</span><br><span style=\"color:hsl(0, 0%, 0%);\">• Labor Komputer</span><br><span style=\"color:hsl(0, 0%, 0%);\">• Bengkel Tepat Guna</span><br><span style=\"color:hsl(0, 0%, 0%);\">• Bengkel Beton</span><br><span style=\"color:hsl(0, 0%, 0%);\">• Bengkel Drainage</span><br><span style=\"color:hsl(0, 0%, 0%);\">• Bengkel Batu</span></p>', 'D4_Manajemen_Rekayasa_Konstruksi.jpg', '2023-11-28 01:15:56', '2023-11-28 01:15:56'),
(21, 9, '4PJJ', 'D4 Perancangan Jalan Dan Jembatan', 'B / Baik Sekali', '<p><span style=\"color:hsl(0, 0%, 0%);\"><strong>Program D4 Perancangan Jalan dan Jembatan (Akreditasi B)</strong></span><br>&nbsp;</p><p><span style=\"color:hsl(0, 0%, 0%);\">Menghasilkan tenaga kerja profesional di lapangan yang dititik-beratkan pada Perancangan Jalan dan Jembatan. Agar terciptanya tenaga kerja profesional yang mampu merencanakan serta menghitung anggaran biaya proyek-proyek dalam skala besar sekaligus menganalisis dan memilih material yang baik untuk bangunan jalan dan jembatan yang sesuai dengan tuntutan dunia kerja. Serta menciptakan atmosfir penelitian yang berkaitan dengan studi kasus dalam bidang kegagalan dan kerusakan konstruksi jalan dan jembatan guna pengembangan ilmu</span></p><p><span style=\"color:hsl(0, 0%, 0%);\"><strong>Fasilitas Pendukung :</strong></span><br><span style=\"color:hsl(0, 0%, 0%);\">• Labor Material</span><br><span style=\"color:hsl(0, 0%, 0%);\">• Labor Hidrolika</span><br><span style=\"color:hsl(0, 0%, 0%);\">• Labor Mekanika Tanah</span><br><span style=\"color:hsl(0, 0%, 0%);\">• Labor Stuktur</span><br><span style=\"color:hsl(0, 0%, 0%);\">• Labor Ilmu Ukur Tanah</span><br><span style=\"color:hsl(0, 0%, 0%);\">• Labor Komputer</span><br><span style=\"color:hsl(0, 0%, 0%);\">• Bengkel Tepat Guna</span><br><span style=\"color:hsl(0, 0%, 0%);\">• Bengkel Beton</span><br><span style=\"color:hsl(0, 0%, 0%);\">• Bengkel Drainage</span><br><span style=\"color:hsl(0, 0%, 0%);\">• Bengkel Batu</span></p>', 'D4_Perancangan_Jalan_Dan_Jembatan.jpg', '2023-11-28 01:18:12', '2023-11-28 01:18:12'),
(22, 9, '4TPIR', 'D4 Teknik Perencanaan Irigasi Dan Rawa', 'A / Unggul', '<p><span style=\"color:hsl(0, 0%, 0%);\"><strong>Program Studi D4 Teknik Perencanaan Irigasi dan Rawa (Akreditasi B)</strong></span><br>&nbsp;</p><p><span style=\"color:hsl(0, 0%, 0%);\">Merupakan program lanjutan dari lulusan Diploma III dari program studi Teknik Sipil dan D.III yang Relevan. Program studi ini menghasilkan lulusan yang terampil dan handal dalam bidang perencanaan dan pelaksanaan bangunan irigasi dan rawa.</span></p><p><span style=\"color:hsl(0, 0%, 0%);\"><strong>Fasilitas Pendukung :</strong></span><br><span style=\"color:hsl(0, 0%, 0%);\">• Labor Material</span><br><span style=\"color:hsl(0, 0%, 0%);\">• Labor Hidrolika</span><br><span style=\"color:hsl(0, 0%, 0%);\">• Labor Mekanika Tanah</span><br><span style=\"color:hsl(0, 0%, 0%);\">• Labor Struktur</span><br><span style=\"color:hsl(0, 0%, 0%);\">• Labor Ilmu Ukur Tanah</span><br><span style=\"color:hsl(0, 0%, 0%);\">• Labor komputer</span><br><span style=\"color:hsl(0, 0%, 0%);\">• Bengkel Tepat guna</span><br><span style=\"color:hsl(0, 0%, 0%);\">• Bengkel Acuan Perancah</span><br><span style=\"color:hsl(0, 0%, 0%);\">• Bengkel Rainange</span></p>', 'D4_Teknik_Perencanaan_Irigasi_Dan_Rawa.jpg', '2023-11-28 01:20:16', '2023-11-28 01:20:16'),
(23, 10, '3EC', 'D3 Teknik Elektronika', 'B / Baik Sekali', '<p><span style=\"color:hsl(0, 0%, 0%);\"><strong>Program Studi D.3 Teknik Elektronika</strong></span></p><p><span style=\"color:hsl(0, 0%, 0%);\">Menitik beratkan dalam bidang elektronika industri, meliputi perancangan rangkaian elektronika industri, menganalisis untuk perbaikan dan perawatan control serta mengaplikasikan komputer dan mikrocontroller untuk industri.</span></p><p><span style=\"color:hsl(0, 0%, 0%);\"><strong>Visi program studi</strong></span></p><p><span style=\"color:hsl(0, 0%, 0%);\">Pada tahun 2025 menjadi lembaga pendidikan terbaik di Indonesia dalam bidang ilmu elektronika dan berjiwa wirausaha</span></p><p><span style=\"color:hsl(0, 0%, 0%);\"><strong>Misi program studi</strong></span></p><p><span style=\"color:hsl(0, 0%, 0%);\">1.&nbsp;&nbsp;&nbsp; Menyelenggarakan pendidikan vokasional melalui peningkatan penelitian dalam bidang elektronika &nbsp;dan pengabdian masyarakat untuk menghasilkan lulusan yang berkualitas.</span></p><p><span style=\"color:hsl(0, 0%, 0%);\">2.&nbsp;&nbsp;&nbsp; Menyelenggarakan pendidikan vokasional melalui peningkatan system manajemen dan kerjasama dengan industri dan institusi yang terkait dalam bidang elektronika</span></p><p><span style=\"color:hsl(0, 0%, 0%);\">3.&nbsp;&nbsp;&nbsp; Mengembangkan jiwa wirausaha dan produktifitas sumber daya manusia&nbsp; dibidang elektronika dengan meningkatkan kemampuan hardskill dan softskill</span></p><p><span style=\"color:hsl(0, 0%, 0%);\">4.&nbsp;&nbsp;&nbsp; Meningkatkan efisiensi, efektifitas tata kelola dan organisasi yang transparan serta akuntabilitas</span></p><p><span style=\"color:hsl(0, 0%, 0%);\"><strong>Tujuan program studi</strong></span></p><p><span style=\"color:hsl(0, 0%, 0%);\">1.&nbsp;&nbsp; Menghasilkan lulusan tenaga&nbsp; ahli madya yang professional,cerdas dan bermartabat.</span></p><p><span style=\"color:hsl(0, 0%, 0%);\">2.&nbsp;&nbsp; Menjadikan PSTE sebagai salah satu pusat pendidikan untuk meningkatkan sumber daya manusia dalam bidang elektronika dan berkarakter wirausaha.</span></p><p><span style=\"color:hsl(0, 0%, 0%);\">3.&nbsp;&nbsp;&nbsp; Mengembangkan IPTEK dalam bidang elektronika terapan yang ramah lingkungan</span></p><p><span style=\"color:hsl(0, 0%, 0%);\"><strong>Fasilitas Pendukung Program Studi D3 Teknik Elektronika:</strong></span></p><ul><li><span style=\"color:hsl(0, 0%, 0%);\">Labor Komputer</span></li><li><span style=\"color:hsl(0, 0%, 0%);\">Labor Mikroprosesor</span></li><li><span style=\"color:hsl(0, 0%, 0%);\">Labor Instrumentasi</span></li><li><span style=\"color:hsl(0, 0%, 0%);\">Labor Sistem Kontrol</span></li><li><span style=\"color:hsl(0, 0%, 0%);\">Labor Analog &amp; Digital</span></li><li><span style=\"color:hsl(0, 0%, 0%);\">Labor Elekttronika Dasar</span></li><li><span style=\"color:hsl(0, 0%, 0%);\">Labor M &amp; R Elektronika</span></li><li><span style=\"color:hsl(0, 0%, 0%);\">Bengkel Mekanik</span></li><li><span style=\"color:hsl(0, 0%, 0%);\">Bengkel Elektronika Dasar</span></li><li><span style=\"color:hsl(0, 0%, 0%);\">Labor Elektronika Industri</span></li></ul>', 'D3_Teknik_Elektronika.jpg', '2023-11-28 01:26:59', '2023-11-28 01:48:25'),
(24, 10, '3EL', 'D3 Teknik Listrik', 'B / Baik Sekali', '<p><span style=\"color:hsl(0, 0%, 0%);\"><strong>Program Studi D.3 Teknik Listrik</strong></span></p><p><span style=\"color:hsl(0, 0%, 0%);\">Berorientasi dalam bidang penerapan tentang instalasi penerangan dan tenaga, teknologi pembangkit. Sistem distribusi listrik, perawatan/ perbaikan mesin – mesin industri serta perancangan dan pengembangan teknik instrumentasi dan kontrol industri.</span></p><p><span style=\"color:hsl(0, 0%, 0%);\"><strong>Visi program studi</strong></span></p><p><span style=\"color:hsl(0, 0%, 0%);\">Menjadi pusat pendidikan, pelatihan dan pengembangan ilmu terapan bidang ketenagalistrikan yang terkemuka di wilayah Indonesia bagian Barat pada tahun 2014.</span></p><p><span style=\"color:hsl(0, 0%, 0%);\"><strong>Misi program studi</strong></span></p><p><span style=\"color:hsl(0, 0%, 0%);\">&nbsp; &nbsp; &nbsp; 1. Meningkatkan&nbsp; sistem manajemen mutu pendidikan di&nbsp; PSTL.</span></p><ol><li><span style=\"color:hsl(0, 0%, 0%);\">Mengembangkan ilmu terapan dibidang ketenagalistrikan yang bermanfaat bagi masyarakat.</span></li><li><span style=\"color:hsl(0, 0%, 0%);\">Menghasilkan lulusan vokasional di bidang ketenagalistrikkan yang mampu bersaing dan menciptakan lapangan pekerjaan sendiri.</span></li><li><span style=\"color:hsl(0, 0%, 0%);\">Mengembangkan hubungan kerjasama dengan industri dan institusi terkait.</span></li></ol><p><span style=\"color:hsl(0, 0%, 0%);\"><strong>Tujuan program studi</strong></span></p><p><span style=\"color:hsl(0, 0%, 0%);\">Menghasilkan lulusan vokasional di bidang ketenagalistrikan yang cerdas, berdayasaing tinggi, mandiri dan bermartabat dengan meningkatkan sistem manajemen mutu pendidikan di PSTL, mengembangkan ilmu terapan dibidang ketenagalistrikan yang bermanfaat bagi masyarakat dan meningkatkan kerjasama dengan industri dan institusi terkait.</span></p><p><span style=\"color:hsl(0, 0%, 0%);\"><strong>Fasilitas Pendukung Program Studi D3 Teknik Listrik :</strong></span></p><ul><li><span style=\"color:hsl(0, 0%, 0%);\">Labor PLC</span></li><li><span style=\"color:hsl(0, 0%, 0%);\">Labor Listrik Dasar</span></li><li><span style=\"color:hsl(0, 0%, 0%);\">Labor Elektronika Daya</span></li><li><span style=\"color:hsl(0, 0%, 0%);\">Labor Rancangan Listrik</span></li><li><span style=\"color:hsl(0, 0%, 0%);\">Labor Jaringan Tegangan Listrik</span></li><li><span style=\"color:hsl(0, 0%, 0%);\">Labor Instrumentasi &amp; Sistem Kendali</span></li><li><span style=\"color:hsl(0, 0%, 0%);\">Labor Komputer</span></li><li><span style=\"color:hsl(0, 0%, 0%);\">Bengkel Kerja Mekanik</span></li><li><span style=\"color:hsl(0, 0%, 0%);\">Bengkel Instalasi Listrik</span></li><li><span style=\"color:hsl(0, 0%, 0%);\">Labor PLTMH</span></li></ul>', 'D3_Teknik_Listrik.jpg', '2023-11-28 01:35:07', '2023-11-28 01:49:27'),
(25, 10, '3TC', 'D3 Teknik Telekomunikasi', 'B / Baik Sekali', '<p><span style=\"color:hsl(0, 0%, 0%);\"><strong>Program Studi D.3 Teknik Telekomunikasi</strong></span></p><p><span style=\"color:hsl(0, 0%, 0%);\">Berorientasi dalam bidang telekomunikasi kawat dan radio khususnya merancang sistem komunikasi dengan tranmisi udara (wireless) dan transmisi kawat (on wire), membuat prototype, memasang jaringan telekomunikasi, merawat dan memperbaiki serta mendiagnosis kerusakan peralatan telekomunikasi multimedia.</span></p><p><span style=\"color:hsl(0, 0%, 0%);\"><strong>Visi program studi</strong></span></p><p><span style=\"color:hsl(0, 0%, 0%);\">Pada Tahun 2025 menjadi pusat pendidikan vokasional yang terbaik dalam bidang telekomunikasi di Indonesia</span></p><p><span style=\"color:hsl(0, 0%, 0%);\"><strong>Misi program studi&nbsp;</strong></span></p><p><span style=\"color:hsl(0, 0%, 0%);\">1.&nbsp;&nbsp;&nbsp; Menyelenggarakan pendidikan vokasi dibidang&nbsp; Teknik Telekomunikasi untuk menghasilkan lulusan yang berkarakter dan mampu berkompetisi ditingkat nasional</span></p><p><span style=\"color:hsl(0, 0%, 0%);\">2.&nbsp;&nbsp;&nbsp; Menyelenggarakan sistem manajemen mutu pendidikan berbasis kinerja</span></p><p><span style=\"color:hsl(0, 0%, 0%);\">3.&nbsp;&nbsp;&nbsp; Mengembangkan ilmu pengetahuan dan teknologi terapan bidang Telekomunikasi sesuai dengan kebutuhan industri.</span></p><p><span style=\"color:hsl(0, 0%, 0%);\">4.&nbsp;&nbsp;&nbsp; Meningkatkan hubungan kerjasama dengan masyarakat,&nbsp; institusi dan industri yang terkait dalam bidang telekomunikasi.</span></p><p><span style=\"color:hsl(0, 0%, 0%);\"><strong>Tujuan program studi&nbsp;</strong></span></p><p><span style=\"color:hsl(0, 0%, 0%);\">1.&nbsp;&nbsp;&nbsp; Menghasilkan lulusan yang&nbsp; vokasional, berkarakter dan kompeten dibidang sistem Telekomunikasi dan jaringan Telekomunikasi&nbsp; multimedia.</span></p><p><span style=\"color:hsl(0, 0%, 0%);\">2.&nbsp;&nbsp;&nbsp; Mewujudkan suasana akademis guna menghasilkan lulusan berintegritas, berkualitas dan kompeten, serta mampu mengembangkan IPTEK dan berkompetisi pada era globalisasi.</span></p><p><span style=\"color:hsl(0, 0%, 0%);\">3.&nbsp;&nbsp;&nbsp; Memiliki staf pengajar yang berintegritas dan kompeten di bidang pendidikan, penelitian dan pengabdian kepada masyarakat ditingkat nasional maupun regional.</span></p><p><span style=\"color:hsl(0, 0%, 0%);\">4.&nbsp;&nbsp;&nbsp; Menyediakan sarana dan prasarana untuk menunjang proses belajar mengajar.</span></p><p><span style=\"color:hsl(0, 0%, 0%);\">5.&nbsp;&nbsp;&nbsp; Memiliki sistem pengelolaan administrasi, keuangan dan informasi secara terintegrasi, akuntabel dan akurat.</span></p><p><span style=\"color:hsl(0, 0%, 0%);\">6.&nbsp;&nbsp;&nbsp; Menyelenggarakan program pendidikan yang relevan dengan perkembangan teknologi terkini.</span></p><p><span style=\"color:hsl(0, 0%, 0%);\"><strong>Fasilitas Pendukung Program Studi D3 Teknik Telekomunikasi :</strong></span></p><ul><li><span style=\"color:hsl(0, 0%, 0%);\">Labor Antena</span></li><li><span style=\"color:hsl(0, 0%, 0%);\">Labor Jaringan</span></li><li><span style=\"color:hsl(0, 0%, 0%);\">Labor Mekanik</span></li><li><span style=\"color:hsl(0, 0%, 0%);\">Labor Komputer</span></li><li><span style=\"color:hsl(0, 0%, 0%);\">Labor Mikroprosesor</span></li><li><span style=\"color:hsl(0, 0%, 0%);\">Labor Pengolahan Sinyal</span></li><li><span style=\"color:hsl(0, 0%, 0%);\">Labor Dasar Telekomunikasi</span></li><li><span style=\"color:hsl(0, 0%, 0%);\">Labor Rangkaian Elektronika</span></li><li><span style=\"color:hsl(0, 0%, 0%);\">Labor Komunikasi Bergerak</span></li></ul>', 'D3_Teknik_Telekomunikasi.jpg', '2023-11-28 01:38:43', '2023-11-28 01:50:45'),
(26, 10, '4EC', 'D4 Teknik Elektronika', 'A / Unggul', '<p><span style=\"color:hsl(0, 0%, 0%);\"><strong>Visi</strong></span></p><p><span style=\"color:hsl(0, 0%, 0%);\">Pada tahun 2039 Program Studi Sarjana Saint Terapan Teknik Elektronika (PSSTTE) &nbsp;menjadi lembaga pendidikan vokasional yang unggul dibidang Sistem Kontrol dan Instrumentasi industry</span></p><p>&nbsp;</p><p><span style=\"color:hsl(0, 0%, 0%);\"><strong>Misi Keilmuan Program Studi Sarjana Terapan Teknik Elektronika (PSSTTE)</strong></span></p><p><span style=\"color:hsl(0, 0%, 0%);\">Meningkatkan mutu pendidikan vokasional melalui pengembangan tenaga pendidik dan kependidikan sesuai dengan perkembangan ilmu pengetahuan dan teknologi dibidang teknik elektro khususnya bidang Sistem Kontrol dan Intrumentasi Industri</span></p><ol><li><span style=\"color:hsl(0, 0%, 0%);\">Meningkatkan kualitas dan kuantitas penelitian dan pengabdian masyarakat dalam bidang ilmu pengetahuan dan teknologi bidang Sistem Kontrol dan Intrumentasi Industri berbasis kebutuhan DUDIKA</span></li><li><span style=\"color:hsl(0, 0%, 0%);\">Mengembangkan kurikulum yang mendukung program MBKM sesuai dengan standard kompetensi Industri melalui peningkatan kerjasama dengan industri dan institusi yang terkait dalam bidang Sistem Kontrol dan Intrumentasi Industri</span></li><li><span style=\"color:hsl(0, 0%, 0%);\">Mengembangkan sarana dan prasarana proses belajar mengajar</span></li><li><span style=\"color:hsl(0, 0%, 0%);\">Meningkatkan efisiensi, efektifitas tata kelola dan organisasi yang transparan serta akuntabilitas.</span></li><li><span style=\"color:hsl(0, 0%, 0%);\">Membangun dan mengembangkan jiwa wirausaha dengan meningkatkan kemampuan <i>hardskill </i>dan <i>softskill</i></span></li></ol><p>&nbsp;</p><p><span style=\"color:hsl(0, 0%, 0%);\"><strong>Fasilitas Pendukung Program Studi D4 Teknik Elektronika :</strong></span></p><ul><li><span style=\"color:hsl(0, 0%, 0%);\">Workshop Mekanik dan Elektronik</span></li><li><span style=\"color:hsl(0, 0%, 0%);\">Labor Elektronika</span></li><li><span style=\"color:hsl(0, 0%, 0%);\">Labor Digital</span></li><li><span style=\"color:hsl(0, 0%, 0%);\">Labor Sistem Kendali</span></li><li><span style=\"color:hsl(0, 0%, 0%);\">Labor Mikroprosesor dan mikrokontroller</span></li><li><span style=\"color:hsl(0, 0%, 0%);\">Labor Sistem Kendali</span></li><li><span style=\"color:hsl(0, 0%, 0%);\">Labor Otomasi dan Robotika</span></li><li><span style=\"color:hsl(0, 0%, 0%);\">Labor Maintanance dan Repaired</span></li><li><span style=\"color:hsl(0, 0%, 0%);\">Labor Instrumentasi Industri</span></li><li><span style=\"color:hsl(0, 0%, 0%);\">Labor VLSI</span></li><li><span style=\"color:hsl(0, 0%, 0%);\">Labor Elektronika&nbsp; Industri</span></li></ul>', 'D4_Teknik_Elektronika.jpg', '2023-11-28 01:41:08', '2023-11-28 01:51:51'),
(27, 10, '4TC', 'D4 Teknik Telekomunikasi', 'A / Unggul', '<p><span style=\"color:hsl(0, 0%, 0%);\"><strong>Visi program studi</strong></span></p><p><span style=\"color:hsl(0, 0%, 0%);\">Menjadi Pusat Pendidikan Tinggi Vokasi Bidang Telekomunikasi yang Unggul Dalam Bidang Teknologi Jaringan Seluler dan Internet of Things (IoT).</span></p><p><span style=\"color:hsl(0, 0%, 0%);\"><strong>Misi program studi</strong></span></p><ol><li style=\"text-align:justify;\"><span style=\"color:hsl(0, 0%, 0%);\">Menyelenggarakan proses pendidikan vokasi dibidang telekomunikasi untuk menghasilkan lulusan profesional di bidang teknologi jaringan seluler dan internet of things (IoT).</span></li><li style=\"text-align:justify;\"><span style=\"color:hsl(0, 0%, 0%);\">Melaksanakan penelitian dan pengabdian kepada masyarakat (PkM) yang merupakan terapan dalam bidang telekomunikasi.</span></li><li style=\"text-align:justify;\"><span style=\"color:hsl(0, 0%, 0%);\">Mengembangkan ilmu pengetahuan dan teknologi terapan bidang telekomunikasi sesuai dengan kebutuhan industri.</span></li></ol><p><span style=\"color:hsl(0, 0%, 0%);\"><strong>Tujuan program studi</strong></span></p><ol><li><span style=\"color:hsl(0, 0%, 0%);\">Menjadi pusat pendidikan vokasi dalam pengembangan iptek terapan dibidang teknologi jaringan seluler dan Internet of Things (IoT).</span><br><span style=\"color:hsl(0, 0%, 0%);\">2.&nbsp; Mengahasilkan lulusan Sarjana Terapan (Diploma 4) yang profesional dibidang jaringan telekomunikasi seluler dan IoT.</span><br><span style=\"color:hsl(0, 0%, 0%);\">3. Menghasilkan penelitian dan PkM serta luarannya ditingkat nasional dan internasional.</span></li></ol><p><span style=\"color:hsl(0, 0%, 0%);\"><strong>Sasaran program studi</strong></span></p><p><span style=\"color:hsl(0, 0%, 0%);\">Tercapainya pelaksanaan tri dharma Perguruan Tinggi oleh sivitas akademika Program Studi Sarjana Terapan Teknik Telekomunikasi yang dapat diterapkan pada masyarakat sesuai dengan perkembangan iptek.</span></p>', 'D4_Teknik_Telekomunikasi.jpg', '2023-11-28 01:42:52', '2023-11-28 01:53:19'),
(28, 10, '4TRIL', 'D4 Teknologi Rekayasa Instalasi Listrik', 'C / Baik', '<p><span style=\"color:hsl(0, 0%, 0%);\"><strong>Visi program studi</strong></span></p><p style=\"text-align:justify;\"><span style=\"color:hsl(0, 0%, 0%);\">Menghasilkan Tenaga Ahli Vokasi dibidang Teknologi Rekayasa Instalasi Listrik terbaik di Wilayah Indonesia Bagian Barat pada tahun 2026.</span></p><p><span style=\"color:hsl(0, 0%, 0%);\"><strong>Misi program studi</strong></span></p><ol><li style=\"text-align:justify;\"><span style=\"color:hsl(0, 0%, 0%);\">Meningkatkan mutu pendidikan sesuai kompetensi Teknologi Rekayasa Instalasi Listrik dalam rangka mewujudkan Visi.</span></li><li style=\"text-align:justify;\"><span style=\"color:hsl(0, 0%, 0%);\">Mengembangkan ilmu terapan di bidang Teknologi Rekayasa Instalasi Listrik sesuai bidang kompetensi yang dibutuhkan.</span></li><li style=\"text-align:justify;\"><span style=\"color:hsl(0, 0%, 0%);\">Menjalin hubungan kerjasama dengan industri dan institusi tekait dalam rangka <i><strong>link and match </strong></i>sistem pembelajaran dan sarana praktek industri.</span></li><li style=\"text-align:justify;\"><span style=\"color:hsl(0, 0%, 0%);\">Meningkatkan Kompetensi Mutu Pendidikan Vokasi dibidang Teknologi Rekayasa Instalasi Listrik didalam mewujudkan dunia kerja mandiri.</span></li></ol><p><span style=\"color:hsl(0, 0%, 0%);\"><strong>Tujuan program studi</strong></span></p><p style=\"text-align:justify;\"><span style=\"color:hsl(0, 0%, 0%);\">Tujuan Program Studi D IV Teknologi Rekayasa Instalasi Listrik Politeknik Negeri Padang adalah menghasilkan lulusan vokasional didalam mengembangkan keahlian dibidang Teknologi&nbsp; Rekayasa Instalasi Listrik yang cerdas, bermartabat, kompetitif, mandiri yang berjiwa kewirausahaan.</span></p><p><span style=\"color:hsl(0, 0%, 0%);\"><strong>Sasaran</strong></span></p><p style=\"text-align:justify;\"><span style=\"color:hsl(0, 0%, 0%);\">Sasaran &nbsp;pencapaian yang dilaksanakan saat ini, yakni memperkuat program studi dalam&nbsp; &nbsp;mengelola&nbsp; sistem&nbsp; &nbsp;pendidikan&nbsp; &nbsp;vokasional,&nbsp; &nbsp;sehingga&nbsp; &nbsp;menjadi&nbsp; &nbsp;pusat pengembangan tenaga kerja yang kompeten dibidangnya.</span></p><p><span style=\"color:hsl(0, 0%, 0%);\"><strong>Program Studi D.4 Teknologi Rekayasa Instalasi Listrik</strong></span></p><ul><li><span style=\"color:hsl(0, 0%, 0%);\">Labor PLC</span></li><li><span style=\"color:hsl(0, 0%, 0%);\">Labor Listrik Dasar</span></li><li><span style=\"color:hsl(0, 0%, 0%);\">Labor Elektronika Daya</span></li><li><span style=\"color:hsl(0, 0%, 0%);\">Labor Rancangan Listrik</span></li><li><span style=\"color:hsl(0, 0%, 0%);\">Labor Jaringan Tegangan Listrik</span></li><li><span style=\"color:hsl(0, 0%, 0%);\">Labor Instrumentasi &amp; Sistem Kendali</span></li><li><span style=\"color:hsl(0, 0%, 0%);\">Labor Komputer</span></li><li><span style=\"color:hsl(0, 0%, 0%);\">Bengkel Kerja Mekanik</span></li><li><span style=\"color:hsl(0, 0%, 0%);\">Bengkel Instalasi Listrik</span></li></ul>', 'D4_Teknologi_Rekayasa_Instalasi_Listrik.jpg', '2023-11-28 01:47:25', '2023-11-28 01:47:25'),
(29, 11, '3AB', 'D3 Administrasi Bisnis', 'B / Baik Sekali', '<p><span style=\"color:hsl(0, 0%, 0%);font-family:Arial, Helvetica, sans-serif;\"><strong>Program Studi D.3 Administrasi Bisnis (Akreditasi B)</strong></span><br><span style=\"color:hsl(0, 0%, 0%);font-family:Arial, Helvetica, sans-serif;\">Menghasilkan tenaga Ahli Madya profesional dalam bidang kesekretariatan dan administrasi perkantoran sesuai dengan kebutuhan dunia usaha dan dunia industri yang berkeahlian tinggi dalam menagani operasi perkantoran dan berwawasan konseptual yang baik untuk mengembangkan sistem perkantoran bisnis secara menyeluruh.</span></p><h4><span style=\"color:hsl(0, 0%, 0%);font-family:Arial, Helvetica, sans-serif;\"><strong>Visi dan Misi</strong></span></h4><p><span style=\"color:hsl(0, 0%, 0%);font-family:Arial, Helvetica, sans-serif;\">Visi :&nbsp;</span></p><p><span style=\"color:hsl(0, 0%, 0%);font-family:Arial, Helvetica, sans-serif;\">Menjadi Program Studi Administrasi Bisnis unggul, bermartabat, dan berwawasan internasional.</span><br><span style=\"color:hsl(0, 0%, 0%);font-family:Arial, Helvetica, sans-serif;\">Misi:</span></p><p><span style=\"color:hsl(0, 0%, 0%);font-family:Arial, Helvetica, sans-serif;\">1. Menyelenggarakan&nbsp;&nbsp;&nbsp;&nbsp; pendidikan&nbsp;&nbsp;&nbsp;&nbsp; vokasional&nbsp;&nbsp;&nbsp;&nbsp; yang&nbsp;&nbsp;&nbsp;&nbsp;</span><br><span style=\"color:hsl(0, 0%, 0%);font-family:Arial, Helvetica, sans-serif;\">sesuai&nbsp;&nbsp;&nbsp;&nbsp; dengan</span><br><span style=\"color:hsl(0, 0%, 0%);font-family:Arial, Helvetica, sans-serif;\">perkembangan&nbsp;&nbsp; ilmu&nbsp;&nbsp; pengetahuan&nbsp;&nbsp;</span><br><span style=\"color:hsl(0, 0%, 0%);font-family:Arial, Helvetica, sans-serif;\">dan&nbsp;&nbsp; teknologi &nbsp;&nbsp;yang&nbsp;&nbsp;</span><br><span style=\"color:hsl(0, 0%, 0%);font-family:Arial, Helvetica, sans-serif;\">berwawasan internasional;</span></p><p><span style=\"color:hsl(0, 0%, 0%);font-family:Arial, Helvetica, sans-serif;\">2. Menyelenggarakan&nbsp;&nbsp;&nbsp; penelitian&nbsp;&nbsp;&nbsp; yang&nbsp;&nbsp;&nbsp;</span><br><span style=\"color:hsl(0, 0%, 0%);font-family:Arial, Helvetica, sans-serif;\">inovatif&nbsp;&nbsp;&nbsp; dan&nbsp;&nbsp;&nbsp; adaptif untuk pengembangan ilmu pengetahuan</span><br><span style=\"color:hsl(0, 0%, 0%);font-family:Arial, Helvetica, sans-serif;\">dan teknologi;</span></p><p><span style=\"color:hsl(0, 0%, 0%);font-family:Arial, Helvetica, sans-serif;\">3. Menerapkan</span><br><span style=\"color:hsl(0, 0%, 0%);font-family:Arial, Helvetica, sans-serif;\">ilmu pengetahuan dan teknologi dalam rangka memecahkan masalah dan meningkatkan</span><br><span style=\"color:hsl(0, 0%, 0%);font-family:Arial, Helvetica, sans-serif;\">taraf hidup masyarakat;</span></p><p><span style=\"color:hsl(0, 0%, 0%);font-family:Arial, Helvetica, sans-serif;\">4. Menjalin</span><br><span style=\"color:hsl(0, 0%, 0%);font-family:Arial, Helvetica, sans-serif;\">kerja sama yang produktif dan berkelanjutan dengan lembaga pendidikan,</span><br><span style=\"color:hsl(0, 0%, 0%);font-family:Arial, Helvetica, sans-serif;\">pemerintahan, dan dunia usaha ditingkat nasional dan Internasional.</span></p><p><span style=\"color:hsl(0, 0%, 0%);font-family:Arial, Helvetica, sans-serif;\"><strong>Fasilitas Pendukung :</strong></span><br><span style=\"color:hsl(0, 0%, 0%);font-family:Arial, Helvetica, sans-serif;\">• Labor Perkantoran</span><br><span style=\"color:hsl(0, 0%, 0%);font-family:Arial, Helvetica, sans-serif;\">• Labor Pengetikan Manual</span><br><span style=\"color:hsl(0, 0%, 0%);font-family:Arial, Helvetica, sans-serif;\">• Labor Pengetikan Elektric</span><br><span style=\"color:hsl(0, 0%, 0%);font-family:Arial, Helvetica, sans-serif;\">• Labor Simulasi Bisnis</span><br><span style=\"color:hsl(0, 0%, 0%);font-family:Arial, Helvetica, sans-serif;\">• Labor Komputer</span></p>', 'D3_Administrasi_Bisnis.jpg', '2023-11-28 02:03:23', '2023-11-28 02:03:23'),
